function Button(props) {
  return (
    <button
      className="flex w-full bg-gray-800 text-white border border-gray-700 rounded-3xl py-3 font-medium mt-3"
      onClick={props.onClick}
    >
      {props.text}
      {props.icon && <props.icon />}
    </button>
  );
}

export default Button;
